import React, { useState } from 'react';
import './App.css';
import { Hello } from "./components/hello/hello"
import { Button } from "./components/Button/Button"

function App() {
  const [clicked, setClicked] = useState<Boolean>();

  const [name, setName] = useState<String>("Sanzhar");

  const btnClickLoginHandler = (val: boolean) => { 
    console.log("Log in clicked") 
    setClicked(val);
  }

  const btnClickNameHandler = () => { 
    console.log("Change name clicked") 
  }

  return (
    <div className="App">

      <div className="App-wrapper">

        { clicked ? <Hello name={ name } /> : null}

        <button className="btn App-login-btn" onClick = { () => btnClickLoginHandler(!clicked)}> { "Log in" }</button>

        <button className="btn App-login-btn" onClick = { btnClickNameHandler }>Change name</button>

      </div>

    </div>
  );
}

export default App;
